  false,\n\t\"url\": null,\n\t\"notes\": \"Research proposal for evaluating marsh
  and upland habitat management at Alamosa and Monte Vista National Wildlife Refuge
  in the San Luis Valley of Colorado.  This research will evaluate the effectiveness
  of a variety of habitat management techniques, including current management strategy,
  in achieving wildlife habitat goals and objectives of the Alamosa and Monte Vista
  National Wildlife Refuges in Colorado. It will provide the foundation for initiation
  of an adaptive habitat management program aimed at continuously refining management
  practices toward achieving long-term, sustainable landscape and refuge habitat goals.\",\n\t\"license_title\":
